      <>
      <div>
        <h1>Total Cost:</h1>
      </div>
      <div>
        <button>Preview Proposal</button>
      </div>
      <div>
        <h1>Pricing Options</h1>
      </div>
      </>
    );
  }
}

export default ProposalOverview;
